import React, { useState, useEffect } from 'react';
import './App.css';

const NavBar = ({ setActivePage }) => (
  <div className="topnav">
    <ul>
      <li><a href="#" onClick={() => setActivePage('cheesecake')}>Cheesecake</a></li>
      <li><a href="#" onClick={() => setActivePage('order')}>Order Online</a></li>
      <li><a href="#" onClick={() => setActivePage('about')}>About Us</a></li>
      <li><a href="#" onClick={() => setActivePage('contacts')}>Contacts</a></li>
    </ul>
  </div>
);

const Content = ({ activePage }) => {
  const [animation, setAnimation] = useState('');

  useEffect(() => {
    setAnimation('fade-in');
    const timeout = setTimeout(() => {
      setAnimation('');
    }, 1000);
    return () => clearTimeout(timeout);
  }, [activePage]);

  let content;
  switch (activePage) {
    case 'cheesecake':
      content = (
        <div className={`content ${animation}`}>
          <div className="img-container">
            <img src="https://static.vecteezy.com/system/resources/thumbnails/025/066/829/small/cheesecake-with-ai-generated-free-png.png" alt="Cheesecake" />
          </div>
          <p>Learn about our delicious cheesecake!</p>
        </div>
      );
      break;
    case 'order':
      content = (
        <div className={`content ${animation}`}>
          <div className="img-container">
            <img src="https://static.vecteezy.com/system/resources/thumbnails/025/066/829/small/cheesecake-with-ai-generated-free-png.png" alt="Order Online" />
          </div>
          <p>Order your favorite cheesecake online!</p>
        </div>
      );
      break;
    case 'about':
      content = (
        <div className={`content ${animation}`}>
          <div className="img-container">
            <img src="https://static.vecteezy.com/system/resources/thumbnails/025/066/829/small/cheesecake-with-ai-generated-free-png.png" alt="About Us" />
          </div>
          <p>Learn about our company and mission!</p>
        </div>
      );
      break;
    case 'contacts':
      content = (
        <div className={`content ${animation}`}>
          <div className="img-container">
            <img src="https://static.vecteezy.com/system/resources/thumbnails/025/066/829/small/cheesecake-with-ai-generated-free-png.png" alt="Contacts" />
          </div>
          <p>Contact us for any inquiries!</p>
        </div>
      );
      break;
    default:
      content = <div>Page not found</div>;
  }
  return content;
};

const App = () => {
  const [activePage, setActivePage] = useState('cheesecake');

  return (
    <div>
      <NavBar setActivePage={setActivePage} />
      <Content activePage={activePage} />
    </div>
  );
};

export default App;
